if mibBuilder.loadTexts: frPVCEndptTable.setDescription("The Frame Relay PVC End-Point table. This table is used to model a PVC end-point. This table contains the traffic parameters and statistics for a PVC end-point. This table is used to identify the traffic parameters for a bi-directional PVC segment end- point, and it also provides statistics for a PVC segment end-point. A PVC segment end-point is identified by a UNI/NNI logical port index value and DLCI index value. If the frame relay service provider allows the frame relay CNM subscriber to create, modify or delete PVCs using SNMP, then this table is used to identify and reserve the requested traffic parameters of each PVC segment end-point. The Connection table is used to 'connect' the end- points together. Not all implementations will support the capability of creating/modifying/deleting PVCs using SNMP as a feature of frame relay CNM service. Uni-directional PVCs are modeled with zero valued traffic parameters in one of the directions (In or Out direction) in this table. To create a PVC, the following procedures shall be followed: 1) Create the entries for the PVC segment endpoints in the frPVCEndptTable by specifying the traffic parameters for the bi-directional PVC segment endpoints. As shown in figure 2, a point-to-point PVC has two endpoints, thus two entries in this table. Uni-directional PVCs are modeled with zero valued traffic parameters in one direction; all the `In' direction parameters for one frame relay PVC End-point or all the `Out' direction parameters for the other frame relay PVC Endpoint. In _____________________________ Out >>>>>>| |>>>>>>>> ______| Frame Relay Network |________ Out | | In <<<<<<|_____________________________|<<<<<<<< Frame Relay Frame Relay PVC PVC Endpoint Endpoint Figure 2, PVC Terminology 2) Go to the Frame Relay Connection Group.")
